import React, { Component, Fragment } from "react";
import { withAlert } from "react-alert";

export class Todo extends Component {
  componentDidMount() {
    this.props.alert.show("123");
  }
  render() {
    return <Fragment />;
  }
}

export default withAlert(Todo);
